review_content:
• Điểm +:
+ Mẫu mã đẹp, gọn, nhẹ;
+ Tốc độ truy xuất cao;
+ Nhiệt độ ổ cứng thấp khi truy cập cường độ cao;
- Giao hàng nhanh
• Điểm -:
-  Đóng gói hàng lỏng lẻo (đây là hàng điện tử giá trị cao, nhưng đóng gói không nêm chèn (lỗi này rất thường thấy ở tiki))

- Giao hàng đúng trong khoảng thời gian giới hạn;
- Hàng được giao vẫn nằm trong hộp, không nứt, vỡ. NHƯNG thanh RAM bị rời ra khỏi ổ chứa trong hộp xốp;
- Vẫn còn niêm phong (seal) ngoài hộp và tem bảo hành (warranty);
- Lắp vô thì máy vẫn nhận biết được và hoạt động tốt:
  + Tỉ lệ Memory đang sử dụng được hiển thị trong Task Manager thấp hơn bình thường;
  + Dùng app CPU-Z để kiểm tra thông số thì không có vấn đề gì;
  + Các dòng game chuyên ngốn RAM như The Sims 4 hay Total War hoạt động trơn tru hơn.
- Chất lượng, độ bền của sản phẩm thì cần nhiều thời gian hơn để kiểm tra.
